import React from "react";
import { Link } from "react-router-dom";

const navStyle =  {
    display: "block",
    width: "100%",
    height:"100%",
    color: "white"
}; 

function Nav() {
  return (
    <nav style={navStyle}>
      <h4>Google Books</h4>
      <li className="link-wrapper">
        <Link to="/" activeClassName="active">
          Search
        </Link>
      </li>
      <li className="link-wrapper">
        <Link to="/saved">Saved</Link>
      </li>
    </nav>
  );
}

export default Nav;
